def maxProduct(nums: 'List[int]'):
    minimum = [nums[0]]*len(nums)
    maximum = [nums[0]]*len(nums)
    dp = [nums[0]]*len(nums)

    for i in range(1,len(nums)):
        dp[i] = max(nums[i]*maximum[i-1] , nums[i] * minimum[i-1] , nums[i])
        minimum[i] = min(nums[i]*maximum[i-1] , nums[i] * minimum[i-1] , nums[i])
        maximum[i] = max(nums[i]*maximum[i-1] , nums[i] * minimum[i-1] , nums[i])

    return max(maximum)


